Delphine, is a resident ambassador at the UofI wildlife clinic. She presented to the Wildlife Medical Clinic in 2017 after a well-intentioned member of the public attempted to rehabilitate her. Unfortunately, she ended up getting too habituated to humans to be releasable. Due to her calm demeanor and overall good health, she was a good candidate to become a Wildlife Ambassador. During her transition, her care team noted a hernia and uneven gait. After further testing, Delphine underwent an FHO to allow pain-free mobility of a previously damaged right hip. This, along with scaring along that same side, lead us to conclude she was likely hit by a car before being found. Her story illustrates how important it is for injured wildlife to be brought to licensed rehabilitators. She makes a wonderful addition to the resident ambassador team and is the best girl. üíì
